    false,nt"url": null,nt"notes": "This Narrative Report for Malheur National
    Wildlife Refuge summarizes refuge activities from May through August of 1954.  The
    report begins with general information about the yearu2019s weather conditions,
    water conditions, and fires.  Wildlife- including migratory birds, upland game birds,
    big game animals, fur animals, predators, rodents, other mammals, predaceous birds,
    and fish- is also covered.  The report includes a refuge development and maintenance
    section which discusses physical developments.  Economic uses of the refuge are
    outlined; grazing and plantings are the primary uses.  A progress report on field
    investigations and applied research is also included.  The public relations section
    of the report discusses refuge visitors.  Finally, items of interest, photographs,
    and N-R forms are provided.",nt"license_title": "License Not Specified",nt"extras":
